import React from "react";
import Card from "./Card";
import Items from "./Items"
const HomeList = ()=>{
    return <>
    <div className="product_list">
        {Items.map((product)=>(
            <Card
                name={product.name}
                price={product.price}
                image={product.image}
            />
        ))}
    </div>
    </>
}
export default HomeList;
